import React from "react";
import "../Home/style.css";

function Signup() {
  return (
    <section id="signup">
      <h2>Sign up</h2>
      <form>
        <div>
          <input type="text" name="username" />
        </div>
        <div>
          <input type="password" name="password" />
        </div>
        
        <button type="submit">Log in</button>
      </form>
    </section>
  );
}

export default Signup;
